paths:
  tmp0:
    post:
      description: Active an application
      parameters:
      - description: ''
        example: ''
        in: query
        name: Application ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Okta Activate Application by ID
  tmp1:
    post:
      description: Adds a user to a group or removes a user from a group by ID
      parameters:
      - description: ID of the group
        example: ''
        in: query
        name: Group ID
        required: true
        schema: {type: string}
      - description: ID of the user to remove/add.
        example: ''
        in: query
        name: user ID
        required: true
        schema: {type: string}
      - description: If true, the user will be removed from the group. If False, the
          user will be added.
        example: ''
        in: query
        name: Remove User
        required: true
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Okta Add or Remove User from Group
  tmp10:
    post:
      description: Activate User in Okta
      parameters:
      - description: ID of User to Activate
        example: ''
        in: query
        name: ID of User
        required: true
        schema: {type: string}
      - description: if true, sends an activation email to the user and returns url/token.
        example: ''
        in: query
        name: Send Activation Email
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: Okta Activate User
  tmp11:
    post:
      description: Deactivate User in Okta
      parameters:
      - description: ID of User to Activate
        example: ''
        in: query
        name: ID of User
        required: true
        schema: {type: string}
      - description: if true, sends a deactivation email to the admin.
        example: ''
        in: query
        name: Send Deactivation Email
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp11'}
          description: Successful request
      summary: Okta Deactivate User
  tmp12:
    post:
      description: List, Get, Filter and Search Users
      parameters:
      - description: Finds a user that matches firstName, lastName, and email properties
        example: swimlane.com
        in: query
        name: Find Users
        required: false
        schema: {type: string}
      - description: Filters users with a supported expression for a subset of properties.
          Please see examples in readme.
        example: status eq "ACTIVE"
        in: query
        name: Filter Expression
        required: false
        schema: {type: string}
      - description: Searches for users with a supported filtering expression for
          most properties. Please see examples in readme.
        example: profile.department eq "Engineering"
        in: query
        name: Search User
        required: false
        schema: {type: string}
      - description: If supplied, returns the user by id and ignores all other inputs.
        example: 00u1ero7vZFVEIYLWPBN
        in: query
        name: User ID
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp12'}
          description: Successful request
      summary: Okta Users
  tmp2:
    post:
      description: Deactivate an application
      parameters:
      - description: ''
        example: ''
        in: query
        name: Application ID
        required: true
        schema: {type: string}
      responses:
