          description: Successful request
      summary: Okta Deactivate Application by ID
  tmp3:
    post:
      description: Delete an application by ID
      parameters:
      - description: ''
        example: ''
        in: query
        name: Application ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Okta Delete Application by ID
  tmp4:
    post:
      description: List events, filter events, get events for user.
      parameters:
      - description: Filters the log events results by one or more exact keywords.
        example: Jane Doe
        in: query
        name: Keyword Filter
        required: false
        schema: {type: string}
      - description: Filter Expression that filters the results. Please see readme
          for examples.
        example: eventType eq "user.session.start" and outcome.result eq "FAILURE"
        in: query
        name: Filter
        required: false
        schema: {type: string}
      - description: Filters the lower time bound of the log events published property.
          Formatted in ISO 8601
        example: '2017-05-03T16:22:18Z'
        in: query
        name: Since
        required: false
        schema: {type: string}
      - description: Limit the number of events returned. Defaults to 100
        example: '50'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Filters the upper time bound of the log events published property.
          Formatted in ISO 8601
        example: '2017-05-03T16:22:18Z'
        in: query
        name: Since
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: Okta Events
  tmp5:
    post:
      description: Get an application by ID
      parameters:
      - description: ''
        example: ''
        in: query
        name: Application ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: Okta Get Application by ID
  tmp6:
    post:
      description: Returns applications registered in Okta, filters possible.
      parameters:
      - description: Filters apps by status, user.id, group.id or credentials.signing.kid
          expression. See readme for examples.
        example: status eq "ACTIVE"
        in: query
        name: Filter
        required: false
        schema: {type: string}
      - description: Searches the name or displayName property of applications.
        example: oidc_client
        in: query
        name: Query
        required: false
        schema: {type: string}
      - description: Number of applications to return. Defaults to 100.
        example: ''
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Traverses the users link relationship and optionally embeds the
          Application User resource. Only one expantion and must be used with user.ed
          eq ":uid" filter.
        example: user/00ucw2RPGIUNTDQOYPOF
        in: query
        name: Expand
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: Okta Get Applications
  tmp7:
    post:
      description: Returns all applications by user ID
      parameters:
      - description: ''
        example: ''
