              schema: {$ref: '#/components/schemas/tmp8'}
          description: Successful request
      summary: Okta Get User Event of Removed Applications
  tmp9:
    post:
      description: List groups
      parameters:
      - description: Searches the name property of groups for matching value.
        example: Swimlane Group
        in: query
        name: Name Filter
        required: false
        schema: {type: string}
      - description: Filter expression for groups. Please see examples in readme.
        example: type eq "OKTA_GROUP"
        in: query
        name: Filter Expression
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
